        public String ID;
        public int amount;
        public String grade;
        public String name;
        public int price;
        public Category subtype;
        public String type;
        public int expCrafting;
        public int levelToCraft;
        public final Needs needs;
        public final ItemAttributes attributes;

    Item( String ID, int amount, String grade, String name,  int price,  Category subtype, String type, int expCrafting, int levelToCraft, Needs needs, ItemAttributes attributes) {
     this.ID = ID;
     this.amount = amount;
     this.grade = grade;
     this.name = name;
     this.price = price;
     this.subtype = subtype;
     this.type = type;
     this.expCrafting = expCrafting;
     this.levelToCraft = levelToCraft;
     this.needs = needs;
     this.attributes = attributes;
  }
    public static class ItemAttributes {

        public final int Dbrutal;
        public final int Dletal;
        public final int Dmistic;
        public final int armor;
        public final int resistance;
        public final int accuracy;
        public final int evasion;
        public final int critic;
        public final int maxHealth;

        public ItemAttributes(int Dbrutal,int Dletal,int Dmistic,int armor,int resistance,int accuracy,int evasion,int critic,int maxHealth) {

            this.Dbrutal = Dbrutal;
            this.Dletal = Dletal;
            this.Dmistic = Dmistic;
            this.armor = armor;
            this.resistance = resistance;
            this.accuracy = accuracy;
            this.evasion = evasion;
            this.critic = critic;
            this.maxHealth = maxHealth;
        }
    }
    public static class Needs {
        public String item1;
        public int amountItem1;
        public String item2;
        public int amountItem2;
        public String item3;
        public int amountItem3;

        public Needs(String item1, int amountItem1, String item2, int amountItem2, String item3, int amountItem3) {
            this.item1 = item1;
            this.amountItem1 = amountItem1;
            this.item2 = item2;
            this.amountItem2 = amountItem2;
            this.item3 = item3;
            this.amountItem3 = amountItem3;
        }
    }
